import { createRouter, createWebHashHistory } from 'vue-router'
import SignIn from '../views/SignIn.vue'

const routes = [
  {
    path: '/',
    name: 'SignIn',
    component: SignIn
  },
  {
    path: '/FirstPage',
    name: 'FirstPage',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () => import(/* webpackChunkName: "about" */ '../views/FirstPage.vue')

  },

  {
    path: '/InfoList',
    name: 'InfoList',
    component: () => import('../views/InfoList.vue'),
    children:[
      {
        path:'InfoDetail',
        component : () => import('../views/InfoDetail.vue')
      }
    ]
  },


  {
    path: '/PP1Detail',
    name: 'PP1Detail',
    component: () => import('../views/PP1Detail.vue'),
  },
  {
    path: '/PP1Detail/PP1Search',
    name: 'PP1Search',
    component: () => import('../views/PP1Search.vue'),

  },
  {
    path: '/PP1Detail/PP1Search/PP1Result',
    name: 'PP1Result',
    component: () => import('../views/PP1Result.vue'),
  },


  {
    path: '/PP2Detail',
    name: 'PP2Detail',
    component: () => import('../views/PP2Detail.vue'),
  },
  {
    path: '/PP2Detail/PP2Search',
    name: 'PP2Search',
    component: () => import('../views/PP2Search.vue'),

  },
  {
    path: '/PP2Detail/PP2Search/PP2Result',
    name: 'PP2Result',
    component: () => import('../views/PP2Result.vue'),
  },




  {
    path: '/PP3Detail',
    name: 'PP3Detail',
    component: () => import('../views/PP3Detail.vue'),
  },
  {
    path: '/PP3Detail/PP3Search',
    name: 'PP3Search',
    component: () => import('../views/PP3Search.vue'),

  },
  {
    path: '/PP3Detail/PP3Search/PP3Result',
    name: 'PP3Result',
    component: () => import('../views/PP3Result.vue'),
  },

  {
    path: '/PostPage',
    name: 'PostPage',
    component: () => import('../views/PostPage.vue')
  }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
